configure:
  commands:
    end:
      new_state: execute
    interface HundredGigE1/0/21: "interface HundredGigE1/0/21\r\n"
    line console:
      new_state: configure_line
    line console 0:
      new_state: configure_line
    no ipv6 traffic-filter racl-1 in: "no ipv6 traffic-filter racl-1 in\r\n"
    no logging console: ''
  prompt: Intrepid-DUT-1(config)#
configure_line:
  commands:
    end:
      new_state: execute
    exec-timeout 0: ''
    line vty: ''
    terminal width 511: ''
  prompt: Intrepid-DUT-1(config-line)#
connect:
  commands:
    ? ''
    : new_state: execute
  preface: 'Trying mock_device ...

    Connected to mock_device.

    Escape character is ''^]''.'
  prompt: ''
execute:
  commands:
    config term:
      new_state: configure
    config-transaction:
      new_state: configure
    show version: ''
    term length 0: ''
    term width 0: ''
    term width 511: ''
    terminal session-timeout 0: ''
  prompt: Intrepid-DUT-1#
